DROP DATABASE IF EXISTS daw_calidad_aire;
CREATE DATABASE daw_calidad_aire
  CHARACTER SET utf8mb4
  COLLATE utf8mb4_unicode_ci;
USE daw_calidad_aire;

DROP TABLE IF EXISTS air_quality;
DROP TABLE IF EXISTS stations;


CREATE TABLE `stations` (
  `cod_local` INT NOT NULL,
  `cod_estacion_dem` VARCHAR(16),
  `n_red` VARCHAR(64),
  `nombre` VARCHAR(128),
  `fecha_ini` DATE,
  `fecha_fin` DATE NULL,
  `latitud_g` DOUBLE NULL,
  `longitud_g` DOUBLE NULL,
  `altitud` INT NULL,
  `n_ccaa` VARCHAR(64),
  `n_provincia` VARCHAR(64),
  `n_municipio` VARCHAR(128),
  `tipo_estacion` VARCHAR(32),
  `tipo_area` VARCHAR(32),
  `tipo_subarea_rural` VARCHAR(64) NULL,
  `est` VARCHAR(16),
  `zona` VARCHAR(64),
  `direccion` VARCHAR(255),
  PRIMARY KEY (`cod_local`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `air_quality` (
  `cod_local` INT NOT NULL,
  `fecha` DATE NOT NULL,
  `As` DOUBLE NULL,
  `BaP` DOUBLE NULL,
  `Cd` DOUBLE NULL,
  `Ni` DOUBLE NULL,
  `PM10` DOUBLE NULL,
  `PM25` DOUBLE NULL,
  `Pb` DOUBLE NULL,
  PRIMARY KEY (`cod_local`, `fecha`),
  CONSTRAINT `fk_air_quality_station` FOREIGN KEY (`COD_LOCAL`) REFERENCES `stations` (`COD_LOCAL`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

START TRANSACTION;


COMMIT;

SET FOREIGN_KEY_CHECKS=1;
